// src/pages/EditPackages.js
import React, { useEffect, useState } from 'react';

export default function EditPackages() {
  const [packages, setPackages] = useState([]);
  const [newPackage, setNewPackage] = useState({
    destination: '',
    price: '',
    duration: '',
    activities: ''
  });

  // Fetch all packages
  useEffect(() => {
    fetch('http://localhost:5001/packages')
      .then(res => res.json())
      .then(data => setPackages(data))
      .catch(err => console.error('Error fetching packages:', err));
  }, []);

  const handleInputChange = (field, value) => {
    setNewPackage(prev => ({
      ...prev,
      [field]: value
    }));
  };

  const handleAddPackage = async () => {
    const { destination, price, duration, activities } = newPackage;
    if (!destination || !price || !duration || !activities) {
      alert('All fields are required');
      return;
    }

    const response = await fetch('http://localhost:5001/packages', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({
        destination,
        price: Number(price),
        duration: Number(duration),
        activities: activities.split(',').map(act => act.trim())
      })
    });

    if (response.ok) {
      const data = await response.json();
      setPackages(prev => [...prev, { ...newPackage, _id: data.package_id }]);
      setNewPackage({ destination: '', price: '', duration: '', activities: '' });
    } else {
      alert('Failed to add package');
    }
  };

  const handleDelete = async (id) => {
    const response = await fetch(`http://localhost:5001/packages/${id}`, {
      method: 'DELETE'
    });

    if (response.ok) {
      setPackages(prev => prev.filter(pkg => pkg._id !== id));
    } else {
      alert('Failed to delete package');
    }
  };

  return (
    <div className="p-6">
      <h2 className="text-3xl font-bold mb-6 text-center">Edit Packages</h2>

      <div className="space-y-4 mb-10">
        {packages.map(pkg => (
          <div key={pkg._id} className="grid grid-cols-5 gap-4 items-center bg-white p-4 rounded shadow">
            <div><strong>{pkg.destination}</strong></div>
            <div>${pkg.price}</div>
            <div>{pkg.duration} days</div>
            <div>{pkg.activities?.join(', ')}</div>
            <button
              onClick={() => handleDelete(pkg._id)}
              className="bg-red-500 text-white px-4 py-1 rounded hover:bg-red-600"
            >
              Delete
            </button>
          </div>
        ))}
      </div>

      <h3 className="text-xl font-semibold mb-2">Add New Package</h3>
      <div className="grid grid-cols-5 gap-4 items-center bg-gray-100 p-4 rounded">
        <input
          type="text"
          placeholder="Destination"
          className="border p-2 rounded"
          value={newPackage.destination}
          onChange={(e) => handleInputChange('destination', e.target.value)}
        />
        <input
          type="number"
          placeholder="Price"
          className="border p-2 rounded"
          value={newPackage.price}
          onChange={(e) => handleInputChange('price', e.target.value)}
        />
        <input
          type="number"
          placeholder="Duration (days)"
          className="border p-2 rounded"
          value={newPackage.duration}
          onChange={(e) => handleInputChange('duration', e.target.value)}
        />
        <input
          type="text"
          placeholder="Activities (comma separated)"
          className="border p-2 rounded"
          value={newPackage.activities}
          onChange={(e) => handleInputChange('activities', e.target.value)}
        />
        <button
          onClick={handleAddPackage}
          className="bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700"
        >
          Add Package
        </button>
      </div>
    </div>
  );
}
